import React from 'react';
import {
    Button,
    Row,
    Col,
    Navbar,
    Nav,
    Container
} from 'react-bootstrap';
import './HeaderButtons.css';

function HeaderButtons()
{
    return (
        <Container fluid>
            <Row className="header-mobile-buttons">
                <Col xs={6}>
                    <h3>DONATIONS</h3>
                </Col>
                <Col xs={6}>
                    <h3>GET HELP</h3>
                </Col>
            </Row>
        </Container>
    );
}

export default HeaderButtons;
